import * as style from "../../css/light/profileList";
import renderIndexMenu from './renderIndexMenu';
import renderProfileList from './renderProfileList';


//Extends SearchList
export default function ProfileListContainer(props) {
  function listContainer(listName) {
    return (
      <div>
        {renderIndexMenu(props.profileDataToRender[listName.toLowerCase()])}
        {renderProfileList(props.profileDataToRender[listName.toLowerCase()], 
                           props.totalToRenderNumber, 
                           props.focused, 
                           props.setFocused)}
      </div>
    )
  }

  function renderListContainer(listName, i) {
    if (i === 0) return <div>{listContainer(listName)}</div>
    //Adds 10px spacer between profileList containers for readability// 
    else return <div><div style={{height: "10px"}}></div>{listContainer(listName)}</div>
  }

  return (
    <div style={style.listContainer}>
      {(() => {
        return props.listToRender.map((listName, i) => (
          <div key={`ListContainer${i}`}>
            {renderListContainer(listName, i)}
          </div>
        ))
      })()}
    </div>
  )
}
